webpackJsonp([0xe30e0c0f716f],{658:function(a,t){a.exports={data:{markdownRemark:{html:'<p>職場のコーヒーメーカーでいつもコーヒー入れてます。 ちなみにお気に入りはグァテマラのストレートブラックで、必ず最初の一杯は<a href="http://www.amazon.co.jp/gp/product/B015S5545W/ref=as_li_ss_tl?ie=UTF8&#x26;camp=247&#x26;creative=7399&#x26;creativeASIN=B015S5545W&#x26;linkCode=as2&#x26;tag=danmaq-22">完全無欠仕様</a>にしてます。 さておき、今日もいつものようにランチ後のコーヒーを入れていたのですが、なんか異音が……。気になってコーヒーメーカーを見ると、 <em>なんとコーヒーがあふれてきてる！</em> そんな入れちゃらめええぇえあふれちゃうぅううう、ってほど入れたかな？としばらく思考停止したのち、表題に気付いてまたしばらく思考停止。結局20秒ほど、下のウォーターサーバーがビチャビチャになっていく状態を放心状態で眺めていたのち、我に返って拭き掃除。豆30gがお亡くなりになりました。 最近danmaqのプレスリリースでしか更新しなくなっているので、こういう日常の話題も書いていかなくては。</p>',frontmatter:{cover:null,date:"2016-05-23T15:27:31+09:00",strDate:"2016/5/23",title:"大惨事コーヒーフィルター付け忘れ"}}},pathContext:{path:"/ja/blog/2016/05/23-大惨事コーヒーフィルター付け忘れ/",langKey:"ja"}}}});
